"use strict";
module.exports = JSON.parse('{"001":{"name":"OBECN INFORMACE","content":{"001":{"question":"K emu portl slou?","answer":"Platforma uaSOS.org propojuje uprchlky hledajc ubytovn se soukrommi osobami, institucemi, nevldnmi organizacemi a spolenostmi, kter ubytovn nabzej. Na rozdl od jinch iniciativ, kter shromauj podobn daje, platforma uaSOS.org automaticky propojuje oznmen lid v nouzi s nabdkami pomoci, aby poskytla co nejlep pomoc co nejir skupin lid. Dky platform nebudou lid v nouzi muset prochzet stovky dostupnch nabdek pomoci, ale bude jim pedloena ta nejvhodnj a nejaktulnj, pizpsoben jejich potebm. Registrace na platform nen anonymn, co poskytuje bezpenost obma stranm."},"002":{"question":"Kdo vytvoil tento portl?","answer":"Iniciativu podporuj polsk a ukrajinsk nevldn organizace, mstn samosprvy a ada firem, kter nejene poskytuj nejlep technologie, ale tak umouj oslovit statisce lid na obou stranch hranice. Platforma vznikla za asti destek dobrovolnk a je zaloena na pokroilm enginu, kter do budoucna dv monost rozvjet platformu tak, aby slouila i dalm potebm (nap. doprav)."},"003":{"question":"Je to bezpen?","answer":"Platforma byla pln zabezpeena po prvn strnce (vetn problematiky RODO) odbornky spolupracujcmi s advoktn kancel ID Advisory. M tak adu technickch zabezpeen, napklad: osobn daje jsou zpracovvny v cloudu Google, soubor zpracovvanch daj je omezen a pihlaovn probh prostednictvm Facebook a Gmailu, co zajiuje zvenou bezpenost.\\n\\nZrove nejsme schopni ovit vechny osoby, kter vypluj formule prostednictvm portlu. Proto prosm kontaktujte svho hostitele/hostitelku a upesnte si vechny daje ped pobytem."},"004":{"question":"Jak si mohu vytvoit et?","answer":"Chcete-li si vytvoit et, muste vyplnit svou e-mailovou adresu a telefonn slo, na kter vm bude zasln ovovac kd."},"005":{"question":"Musm zadvat sv osobn daje?","answer":"Pro sprvnou registraci je teba uvst e-mailovou adresu a telefonn slo. Vae jmno poadujeme pro usnadnn komunikace mezi stranami."},"006":{"question":"Jak jsou zsady ochrany osobnch daj a GDPR?","answer":"Chcete-li si pest zsady ochrany osobnch daj, pejdte na kartu \\"Zsady ochrany osobnch daj\\"."},"007":{"question":"Mohu svj inzert upravit?","answer":"Chcete-li inzert upravit, kliknte po pihlen na nabdku vedle inzertu (\\"ti teky\\") a vyberte funkci \\"Upravit\\"."},"008":{"question":"Jak mohu odstranit svj inzert?","answer":"Inzert mete odstranit dvma zpsoby:\\n\\npo pihlen kliknte na nabdku vedle oznmen (\\"ti teky\\") a vyberte funkci \\"Odstranit\\" nebo\\n\\nv e-mailu \\"UA SOS - Nali jsme pro vs potencilnho hosta\\" mte monost zvolit monost smazn vpisu."},"009":{"question":"Je zzen tu zpoplatnno?","answer":"Portl je zdarma, je uren na pomoc lidem prchajcm ped vlkou na Ukrajin. V dn fzi registrace ani pouvn naeho portlu se netuj dn poplatky."},"010":{"question":"Jak funguje algoritmus pro provn aplikac?","answer":"Algoritmus prohledv ob databze, aby nael co nejvce potencilnch spojen mezi hostiteli a potencilnmi hosty na zklad jejich poadavk. Kadch 15 minut je algoritmus sputn, aby nael spojen pro nov registrovan uivatele, ale tak pro lidi, kte jet nenali nabdku - nebo odmtli pedchoz nabdku."},"011":{"question":"Budu informovn o stavu?","answer":"Ano, o stavu va dosti vs budeme informovat e-mailem - pravideln kontrolujte svou e-mailovou schrnku.\\n\\nJakmile pro vs najdeme potencilnho hosta/hostitele, upozornme vs na to prostednictvm SMS."}}},"002":{"name":"PRO POMOCNKY/HOSPODE","content":{"001":{"question":"Chci pomoci, jak se mohu stt hostitelem?","answer":"Chcete-li uvolnit msto, zaregistrujte se na portlu, uvete svou e-mailovou adresu, telefonn slo a aktivujte svj et. \\n\\nJakmile pro vs najdeme potencilnho hosta - budeme vs o tom informovat e-mailem a SMS zprvou. Pot budete moci vstoupit na portl, zobrazit si klov informace z formule pro hledn vhodnho hosta a nabdku pijmout nebo odmtnout. \\n\\nJakmile ob strany potvrd spojen, vymnte si kontaktn daje - upesnte si posledn detaily a potvrdte msto setkn. Nezapomete, e ne kad bude mluvit polsky, take e-mail me bt nkdy vhodnj variantou, protoe na internetu je k dispozici mnoho peklada, kter mete vyut k pekladu korespondence."},"002":{"question":"Chci pomhat uprchlkm. Potebuj pomoc jen Ukrajinci?","answer":"V dob vypuknut vlky byli na Ukrajin lid rznch nrodnost - napklad studujc, na sluebnch cestch, na zakzkch apod. Pomhme vem lidem bez ohledu na jejich nrodnost, obanstv, politick nzory, nboenstv, sexuln orientaci nebo pslunost k etnick menin"},"003":{"question":"Mohu uvst, kolik osob chci hostit a zda je napklad preferovna rodina s dtmi?","answer":"Samozejm. Kad, kdo se rozhodne pomoci lidem pichzejcm z Ukrajiny, me deklarovat, kolika lidem chce pomoci tm, e je pijme. Mete tak uvst, zda jste ochotni pijmout nap. rodinu s dtmi, zvata apod."},"004":{"question":"Musm jt na hranici, abych mohl pijmout uprchlka?","answer":"V souasn dob je portl uren pedevm k tomu, aby vm pomohl najt ubytovn pro uprchlky. Pokud jste schopni vyzvednout osobu na hranicch nebo na konkrtnm mst, je to vtno, ale nen to nutn. Takov doplujc informace mete zadat ve formuli. V budoucnu budou pidny dal funkce, kter pomohou pi hledn dopravy, zamstnn atd."},"005":{"question":"Nemluvm ukrajinsky, jak se mohu domluvit?","answer":"Upednostovanou formou komunikace je e-mail. Ke komunikaci s osobou hovoc ukrajinskm jazykem nepotebujete\\nznt ukrajintinu. Na internetu je k dispozici mnoho peklada, kter mete pout k pekladu korespondence."},"006":{"question":"Musm uvst adresu svho bydlit?","answer":"Pro vytvoen tu na portlu muste uvst adresu svho bydlit. Ta se hostovi nezobraz - host uvid pouze msto ubytovn. Doporuujeme, aby se hostitel a host setkali na veejnm mst."},"007":{"question":"Na jakou minimln dobu mohu hostit osobu z Ukrajiny?","answer":"Minimln doba ubytovn osoby z Ukrajiny je jedna noc."},"008":{"question":"Ovuje sluba uivatele portlu?","answer":"Uivatel se pihlauj do svho profilu pomoc e-mailu, Facebook nebo Gmailu a jejich telefonn sla jsou ovena"},"009":{"question":"Mohu se vzdt hostovn uprchlka?","answer":"Jsme si vdomi toho, e v ivot dochz k rznm nahodilm situacm, a proto mete z hostovn uprchlk kdykoli odstoupit. Nezapomete vak, e vae nabdka hostit lidi z Ukrajiny je pro n dleit a je mon, e nebudou moci najt nov msto, kde by mohli penocovat. Dobrovolnictvm se rozhodnete pomoci."},"010":{"question":"Musm uprchlkm finann pomhat?","answer":"Nemuste uprchlkm poskytovat dnou finann pomoc. Je to pouze vae dobr vle."},"011":{"question":"Musm uprchlkm zajistit jdlo?","answer":"Vzhledem k situaci uprchlk je poskytovn potravin, alespo po poten dobu jejich pobytu, vtno, ale zstv dobrovoln."},"012":{"question":"Nepouvm internet, jak mohu hostit uprchlky z Ukrajiny?","answer":"Abyste mohli pomhat uprchlkm z Ukrajiny prostednictvm naeho portlu, muste se na nm zaregistrovat. Pokud vak internet nepouvte denn, mete podat lidi, kte jej pouvaj."},"013":{"question":"Mohu tovat uprchlkm poplatky za sluby?","answer":"Lid pichzejc z Ukrajiny utekli ped vlkou. Zkuste je v tomto tkm obdob podpoit. Pokud se rozhodnete uprchlkm pomoci, potejte tak s tm, e se vm mohou zvit ty za komunln sluby."}}},"003":{"name":"PRO UPRCHLKY / NVTVNKY","content":{"001":{"question":"Jsem uprchlk z Ukrajiny, jak najdu ubytovn?","answer":"Chcete-li si najt ubytovn, zaregistrujte se na portlu, uvete svou e-mailovou adresu, telefonn slo, aktivujte svj et a ve formuli uvete sv poteby. \\n\\nJakmile pro vs najdeme potencilnho hostitele, budeme vs informovat e-mailem a SMS zprvou. Pot budete moci pejt na portl, prohldnout si profil hostitele a pijmout nebo odmtnout jeho nabdku. \\n\\nJakmile ob strany potvrd spojen, vymnte si kontaktn daje - upesnte si posledn detaily a potvrdte, kde se setkte. Nezapomete, e ne kad bude mluvit ukrajinsky - proto me bt nkdy vhodnj e-mailov kontakt, protoe na internetu je k dispozici mnoho pekladatel, kter mete vyut k pekladu konverzace."},"002":{"question":"Mohu potat s dopravou od hranic do clov destinace?","answer":"Ne kad, kdo nabz ubytovn pro uprchlky, je motorizovan nebo me nabdnout dopravu. Nabdka, kterou obdrte, me bt oznaena \\"s dopravou\\". V opanm ppad mete podat hostitele o pomoc v soukrom korespondenci."},"003":{"question":"Mm platit za ubytovn a stravu osob, kter m pijala?","answer":"Pomoc uprchlkm je nezitn a bezplatn. Lid, kte se na portlu zaregistruj a nabdnou pomoc, neoekvaj nic na opltku. Pamatujte vak, e sluba nen zodpovdn za podmnky, za kterch budete pijati. Ujistte se, e nic na opltku neoekvte."}}}}');

