module.exports = JSON.parse('{"001":{"name":"LTALNOS INFORMCIK","content":{"001":{"question":"Mire szolgl a portl?","answer":"Az uaSOS.org platform sszekapcsolja a szllst keres meneklteket a szllst knl magnszemlyekkel, intzmnyekkel, civil szervezetekkel s cgekkel. Ms, hasonl adatokat gyjt kezdemnyezsekkel ellenttben a uaSOS.org platform automatikusan sszekapcsolja a rszorulk bejelentseit a segtsgre vonatkoz ajnlatokkal, hogy a lehet legszlesebb krnek nyjthassa a lehet legjobb segtsget. A platformnak ksznheten a rszorulknak nem kell tbb szz elrhet seglyajnlatot bngsznik, hanem a legmegfelelbb s legaktulisabb ignyeikre szabott ajnlatot kapjk. A platformon val regisztrci nem anonim, ami mindkt fl szmra biztonsgot nyjt."},"002":{"question":"Ki hozta ltre ezt a portlt?","answer":"A kezdemnyezst lengyel s ukrn civil szervezetek, helyi nkormnyzatok s szmos vllalat tmogatja, amelyek nemcsak a legjobb technolgit biztostjk, hanem lehetv teszik, hogy a hatr mindkt oldaln tbb szzezer emberhez eljusson. A platform tbb tucat nkntes rszvtelvel jtt ltre, s egy fejlett motoron alapul, amely a jvben lehetsget ad arra, hogy a platformot ms ignyek (pl. szllts) kiszolglsra is fejlesszk."},"003":{"question":"Biztonsgos?","answer":"A platformot az ID Advisory gyvdi irodval egyttmkd szakrtk teljes mrtkben biztostottk jogi oldalrl (belertve a RODO krdseket is), s szmos technikai biztostkkal is rendelkezik, mint pldul: a szemlyes adatok feldolgozsa a Google felhben trtnik, a feldolgozott adatok kre korltozott, s a naplzs az Facebook s a Gmail segtsgvel trtnik, ami fokozott biztonsgot nyjt. \\n\\nUgyanakkor nem ll mdunkban minden szemlyt ellenrizni, aki a portlon keresztl kitlti az rlapokat. Ezrt krjk, hogy vegye fel a kapcsolatot a vendgltjval/hostesszel, s tisztzza az sszes rszletet a tartzkods eltt."},"004":{"question":"Hogyan hozhatok ltre fikot?","answer":"A fik ltrehozshoz meg kell adnia az e-mail cmt s a telefonszmt, amelyre egy ellenrz kdot kldnk."},"005":{"question":"Meg kell adnom a szemlyes adataimat?","answer":"A megfelel regisztrcihoz meg kell adnia az e-mail cmt s a telefonszmt. A nevt a felek kztti kommunikci megknnytse rdekben krjk."},"006":{"question":"Mi az adatvdelmi politika s a GDPR?","answer":"Az adatvdelmi irnyelvek elolvasshoz lpjen az \\"Adatvdelmi irnyelvek\\" flre."},"007":{"question":"Szerkeszthetem a hirdetsemet?","answer":"A hirdets szerkesztshez a bejelentkezs utn kattintson a hirdets melletti menre (\\"hrom pont\\"), s vlassza a \\"Szerkeszts\\" funkcit."},"008":{"question":"Hogyan tudom trlni a hirdetsemet?","answer":"Hirdetst ktflekppen trlheti:\\nbejelentkezs utn kattintson az rtests melletti menre (\\"hrom pont\\"), s vlassza a \\"Trls\\" funkcit, vagy\\naz \\"UA SOS - Talltunk egy potencilis vendget az n szmra\\" cm e-mailben lehetsge van a bejegyzs trlsnek lehetsgt vlasztani."},"009":{"question":"Van valamilyen dj a fik ltrehozsrt?","answer":"A portl ingyenes, clja, hogy segtse az ukrajnai hbor ell menekl embereket. A regisztrci vagy a portl hasznlatnak semmilyen szakaszban nem szmtunk fel djat."},"010":{"question":"Hogyan mkdik az alkalmazsok prostsnak algoritmusa? ","answer":"Az algoritmus mindkt adatbzisban keres, hogy minl tbb lehetsges kapcsolatot talljon a vendgltk s a potencilis vendgek kztt az ignyeik alapjn. 15 percenknt lefuttatja az algoritmust, hogy kapcsolatot talljon az jonnan regisztrlt felhasznlknak, de azoknak is, akik mg nem talltak ajnlatot - vagy elutastottak egy korbbi ajnlatot."},"011":{"question":"Tjkoztatnak majd a sttuszrl?","answer":"Igen, e-mailben folyamatosan tjkoztatjuk a jelentkezsed llsrl - ellenrizd rendszeresen a postalddat.\\n\\nTovbb, ha tallunk egy potencilis vendget/hostot az n szmra, SMS-ben rtestjk nt."}}},"002":{"name":"A SEGTK/GAZDK SZMRA","content":{"001":{"question":"Szeretnk segteni, hogyan lehetek hzigazda?","answer":"Ahhoz, hogy helyet foglaljon, regisztrljon a portlon, adja meg e-mail cmt, telefonszmt s aktivlja fikjt. \\n\\nAmint tallunk egy potencilis vendget az n szmra - e-mailben s SMS-ben rtestjk errl. Ezutn belphet a portlra, lthatja a legfontosabb informcikat a megfelel vendg rlaprl, s elfogadhatja vagy elutasthatja az ajnlatot. \\n\\nMiutn mindkt fl megersti a kapcsolatot, kicserlik az elrhetsgeket - tisztzzk az utols rszleteket, s megerstik, hogy hol fognak tallkozni. Ne feledje, hogy nem mindenki beszl lengyell, ezrt az e-mail nha knyelmesebb megolds lehet, mivel az interneten szmos fordt ll rendelkezsre, amelyet a levelezs lefordtsra hasznlhat."},"002":{"question":"Csak az ukrnoknak van szksgk segtsgre?","answer":"Amikor a hbor kitrt, Ukrajnban klnbz nemzetisg emberek voltak - pldul tanultak, zleti ton voltak, szerzdssel rendelkeztek stb. Mi minden embernek segtnk, fggetlenl nemzetisgtl, llampolgrsgtl, politikai nzettl, vallstl, szexulis irnyultsgtl vagy etnikai kisebbsghez tartozstl."},"003":{"question":"Megadhatom, hogy hny embert szeretnk vendgl ltni, s pldul elnyben rszestem-e a gyermekes\\ncsaldokat?","answer":"Termszetesen. Mindenki, aki gy dnt, hogy segt az Ukrajnbl rkez embereknek, nyilatkozhat arrl, hogy hny ember befogadsval szeretne segteni. Azt is jelezheti, hogy hajland-e pldul gyermekes csaldot, llatokat stb. befogadni."},"004":{"question":"El kell mennem a hatrra, hogy menekltet fogadjak?","answer":"Jelenleg a portl elssorban arra szolgl, hogy segtsen szllst tallni a menekltek szmra. Ha n kpes felvenni az illett a hatrrl vagy egy adott helyrl, azt szvesen fogadjuk, de nem ktelez. Az ilyen kiegszt informcikat az rlapon adhatja meg. A jvben tovbbi funkcikkal bvl majd, hogy segtsen a szllts, munkahelyek stb. megtallsban."},"005":{"question":"Nem beszlek ukrnul, hogyan tudok kommuniklni?","answer":"A kommunikci elnyben rszestett formja az e-mail. Nem kell ismernie az ukrn nyelvet ahhoz, hogy kommunikljon az ukrn nyelvet beszl szemllyel. Az interneten szmos fordtprogram ll rendelkezsre, amelyek segtsgvel lefordthatja levelezst."},"006":{"question":"Meg kell adnom a lakcmemet?","answer":"A portlon val fik ltrehozshoz meg kell adnia lakcmt. Ez nem jelenik meg a vendg szmra - a vendg csak a szlls vrost ltja. Javasoljuk, hogy a vendglt s a vendg nyilvnos helyen tallkozzon."},"007":{"question":"Milyen minimlis idtartamra tudok fogadni egy ukrajnai szemlyt?","answer":"A minimlis id, hogy egy ukrn vendget fogadjon, egy jszaka."},"008":{"question":"A szolgltats ellenrzi a portl felhasznlit?","answer":"A felhasznlk bejelentkeznek a profiljukat hasznl e-mail, Facebook vagy Gmail segtsgvel, s a telefonszmukat ellenrzik"},"009":{"question":"Lemondhatok egy meneklt befogadsrl?","answer":"Tisztban vagyunk azzal, hogy az let klnbz vletlenszer helyzetekben zajlik, ezrt brmikor lemondhatsz a menekltek befogadsrl. Azonban krlek, ne feledd, hogy az Ukrajnbl rkez emberek szmra fontos az, hogy felajnlod, hogy vendgl ltod ket, s elfordulhat, hogy nem tudnak j helyet tallni jszakra. Az nkntessgeddel gy dntesz, hogy segtesz."},"010":{"question":"Kell-e segtenem a meneklteket anyagilag?","answer":"A meneklteknek nem kell anyagi tmogatst nyjtania, ez kizrlag az n jindulatn mlik."},"011":{"question":"Kteles vagyok-e lelmet biztostani a meneklteknek?","answer":"A menekltek helyzetre val tekintettel az lelem biztostsa - legalbbis a tartzkodsuk kezdeti idszakban - dvzlend, de tovbbra is nkntes."},"012":{"question":"Nem hasznlom az internetet, hogyan fogadhatok meneklteket Ukrajnbl?","answer":"Ahhoz, hogy portlunkon keresztl segthessen az Ukrajnbl rkez meneklteknek, regisztrlnia kell a portlon. Ha azonban nem hasznlja napi szinten az internetet, megkrdezheti azokat, akik hasznljk."},"013":{"question":"Szmlzhatok fel meneklteknek kzzemi djakat?","answer":"Az Ukrajnbl rkez emberek a hbor ell menekltek. Prblja meg tmogatni ket ebben a nehz idszakban. Ha gy dnt, hogy segt a meneklteknek, gondoljon arra is, hogy a kzzemi szmli megnvekedhetnek."}}},"003":{"name":"MENEKLTEK / LTOGATK SZMRA","content":{"001":{"question":"Meneklt vagyok Ukrajnbl, hogyan tallok szllst?","answer":"A szllskeresshez regisztrljon a portlon, adja meg e-mail cmt, telefonszmt, aktivlja fikjt, s adja meg ignyeit az rlapon.\\n\\nAmint tallunk nnek egy potencilis vendgltt, e-mailben s SMS-ben rtestjk nt. Ezutn belphet a portlra, megtekintheti a vendglt profiljt, s elfogadhatja vagy elutasthatja az ajnlatt. \\n\\nMiutn mindkt fl megersti a kapcsolatot, kicserlik az elrhetsgeket - tisztzzk az utols rszleteket, s megerstik, hogy hol fognak tallkozni. Ne feledje, hogy nem mindenki beszl ukrnul - ezrt az e-mailes kapcsolatfelvtel nha knyelmesebb megolds lehet, mivel az interneten szmos fordt ll rendelkezsre, akivel lefordthatja a beszlgetst."},"002":{"question":"Szmthatok a hatrrl a clllomsomra trtn szlltsra?","answer":"Nem mindenki, aki szllst knl meneklteknek, rendelkezik gpjrmvel, vagy tud szlltst biztostani. A kapott ajnlaton szerepelhet a \\"szlltssal\\" megjells. Ellenkez esetben magnlevelezsben krhet segtsget a vendgltjtl."},"003":{"question":"Fizessek-e szllst s elltst annak a szemlynek, aki befogadott?","answer":"A menekltek segtse nzetlen s ingyenes. Azok, akik regisztrlnak a portlon s felajnljk segtsgket, nem vrnak semmit cserbe. Ne feledje azonban, hogy a szolglat nem felels azrt, hogy milyen felttelek mellett fogadjk el nt. Gyzdjn meg rla, hogy nem vr semmit cserbe."}}}}');

