module.exports = JSON.parse('{"001":{"name":"INFORMACJE OGLNE","content":{"001":{"question":"Do czego suy ten portal?","answer":"Platforma uaSOS.org czy uchodcw poszukujcych noclegu z osobami prywatnymi, instytucjami, organizacjami pozarzdowymi i firmami oferujcymi zakwaterowanie. W przeciwiestwie do innych inicjatyw, ktre gromadz podobne dane, platforma uaSOS.org automatycznie czy ogoszenia osb potrzebujcych z ofertami pomocy, aby zapewni jak najlepsz pomoc jak najszerszej grupie osb. Dziki platformie osoby potrzebujce nie bd musiay przeglda setek dostpnych ofert pomocy, ale otrzymaj najbardziej odpowiedni i aktualn, dostosowan do ich potrzeb. Rejestracja na platformie nie jest anonimowa, co zapewnia bezpieczestwo obu stronom."},"002":{"question":"Kto stworzy ten portal?","answer":"Inicjatywa jest wspierana przez polskie i ukraiskie organizacje pozarzdowe, samorzdy oraz wiele firm, ktre nie tylko zapewniaj zastosowanie najlepszych technologii, ale take umoliwiaj dotarcie do setek tysicy ludzi po obu stronach granicy. Platforma powstaa przy udziale kilkudziesiciu wolontariuszy i opiera si na zaawansowanym, silniku, ktry w przyszoci daje moliwo rozwoju platformy tak, aby obsugiwaa te inne potrzeby (np. transport) ."},"003":{"question":"Czy to bezpieczne?","answer":"Platforma zostaa w peni zabezpieczona od strony prawnej (m.in. kwestie RODO) przez ekspertw wsppracujcych z kancelari ID Advisory. Posiada take szereg zabezpiecze technicznych, m.in.: dane osb s procesowane w chmurze Google, zestaw przetwarzanych danych jest ograniczony, a logowanie odbywa si przez portale Facebook oraz Gmail co zapewnia zwikszenie bezpieczestwa. Rwnoczenie, nie jestemy w stanie zweryfikowa wszystkich osb, ktre wypeniaj formularze poprzez portal.\\n\\nDlatego skontaktuj si z gospodarzem/gociem i wyjanijcie wszystkie szczegy przed rozpoczciem pobytu."},"004":{"question":"Jak zaoy konto?","answer":"Aby zaoy konto, naley wypeni poda swj adres e-mail oraz numer telefonu, na ktry zostanie wysany kod weryfikacyjny."},"005":{"question":"Czy musz podawa moje dane osobowe?","answer":"Aby poprawnie si zarejestrowa, naley poda swj adres mailowy oraz numer telefonu. Wpisz swoje imi, by uatwi komunikacj midzy stronami."},"006":{"question":"Gdzie znajd szczegy dotyczce polityki prywatnoci i RODO?","answer":"Aby zapozna si z polityk prywatnoci, wejd w zakadk Polityka prywatnoci."},"007":{"question":"Czy mog edytowa ogoszenie?","answer":"Aby edytowa zgoszenie, po zalogowaniu naley klikn na menu przy zgoszeniu (trzy kropki) i zaznaczy funkcj Edytuj."},"008":{"question":"Jak mog usun swoje ogoszenie?","answer":"Usunicie zgoszenia moe odby si na dwa sposoby:\\n\\npo zalogowaniu naley klikn na menu przy zgoszeniu (trzy kropki) i zaznaczy opcj Usu lub\\n\\nw mailu UA SOS  Znalelimy dla Ciebie potencjalnego gocia istnieje moliwo wyboru opcji Usu zgoszenie. \\n"},"009":{"question":"Czy zaoenie konta wie si z jakimi opatami?","answer":"Portal jest darmowy, ma pomc ludziom uciekajcym przed wojn w Ukrainie. Na adnym etapie rejestracji, ani korzystania z naszego portalu nie jest pobierana opata"},"010":{"question":"Jak dziaa algorytm czcy zgoszenia w pary?","answer":"Algorytm przeszukuje obie bazy w celu znalezienia jak najwikszej liczby potencjalnych pocze pomidzy gospodarzami i potencjalnymi gomi w oparciu o ich wymagania. Co 15 minut algorytm jest uruchamiany, eby znale poczenia dla nowo zarejestrowanych uytkownikw, ale te osb, ktre jeszcze nie znalazy oferty- lub odrzuciy poprzedni ofert."},"011":{"question":"Czy bd informowany o statusie? ","answer":"Tak, bdziemy Ci na bieco informowa mailowo o zmianach statusu Twojego zgoszenia - sprawdzaj regularnie swoj skrzynk pocztow.\\n\\nDodatkowo w momencie znalezienia dla Ciebie potencjalnego gocia/gospodarza poinformujemy Ci o tym SMS-em. "}}},"002":{"name":"DLA POMAGAJCYCH / GOSPODARZY ","content":{"001":{"question":"Chc pomc, jak mog udostpni nocleg?","answer":"Aby udostpni lokum, zarejestruj si w portalu, podaj adres mailowy, numer telefonu i aktywuj konto, a w formularzu opisz swoje lokum.\\n\\nTak szybko, jak tylko znajdziemy dla Ciebie potencjalnego gocia  poinformujemy Ci o tym mailowo i SMS-em. Bdziesz mg wtedy wej na portal, zobaczy kluczowej informacje z formularza dopasowanego gocia i zaakceptowa lub odrzuci ofert.\\n\\nW momencie kiedy obie strony potwierdz poczenie, wymienimy midzy Wami szczegy kontaktowe  wyjanijcie wtedy ostatnie detale i potwierdcie, gdzie si spotkacie. Pamitaj, e nie wszyscy bd mwi po polsku, dlatego kontakt mailowy moe czasem by wygodniejsz opcj, gdy w Internecie jest dostpnych wiele translatorw, ktrych moecie uy do przetumaczenia korespondencji."},"002":{"question":"Chc pomc uchodcom. Czy pomocy potrzebuj tylko Ukraicy?","answer":"W chwili wybuchu wojny na terenie Ukrainy przebywali ludzie rnych narodowoci  np. studiowali, byli w delegacjach, na kontraktach itp. Pomagamy wszystkim osobom, niezalenie od ich narodowoci, obywatelstwa, pogldw politycznych, wyznania, orientacji seksualnej czy przynalenoci do mniejszoci etnicznej."},"003":{"question":"Czy mog wskaza, ile osb chc przyj i czy preferowana jest np. rodzina z dziemi?","answer":"Oczywicie. Wszyscy, ktrzy zdecyduj si pomc osobom przyjedajcym z Ukrainy, mog zadeklarowa, ilu ludziom chc udzieli pomocy, przyjmujc ich pod swj dach. Moesz te wskaza, czy jeste gotw przyj np. rodzin z dziemi, zwierzta itp."},"004":{"question":"Czy musz pojecha na granic, eby odebra uchodc?","answer":"Na t chwil portal ma pomc przede wszystkim w znalezieniu lokum dla uchodcw. Jeli moesz we wasnym zakresie odebra dan osob z granicy lub z konkretnego miejsca, to jest to mile widziane, ale nie jest wymagane. Moesz tak dodatkow informacj zgosi w formularzu. W przyszoci dodawane bd dodatkowe funkcjonalnoci dotyczce pomocy w znalezieniu transportu, pracy itd.\\n"},"005":{"question":"Nie znam jzyka ukraiskiego, jak mog si porozumie?","answer":"Preferowan form komunikacji jest kontakt mailowy. Nie musisz zna jzyka ukraiskiego, aby porozumie si z osob mwic w tym jzyku. W Internecie dostpnych jest wiele translatorw, ktrych moecie uy do przetumaczenia waszej korespondencji."},"006":{"question":"Czy musz podawa swj adres zamieszkania?","answer":"Aby zaoy konto na portalu, musisz poda swj adres zamieszkania. Nie bdzie on wywietlany gociowi - zobaczy on tylko miasto, w ktrym oferujesz nocleg. Sugerujemy, aby gospodarz i go spotkali si w miejscu publicznym."},"007":{"question":"Na jaki minimalny okres mog przyj osob z Ukrainy?","answer":"Minimalny czas przyjcia osoby z Ukrainy to jeden nocleg."},"008":{"question":"Czy serwis weryfikuje uytkownikw portalu?","answer":"Uytkownicy loguj si wykorzystujc swj profil na portalach Facebook lub Gmail, dodatkowo podawane s numery telefonw. Na tym etapie serwis nie weryfikuje w inny sposb osb rejestrujcych si w portalu."},"009":{"question":"Czy mog zrezygnowa z goszczenia uchodcw?","answer":"Zdajemy sobie spraw z tego, e w yciu zdarzaj si rne sytuacje losowe, dlatego w kadej chwili moesz zrezygnowa z goszczenia uchodcw. Pamitaj jednak, e Twoja propozycja ugoszczenia osb z Ukrainy jest dla nich wana i mog one nie by w stanie znale z dnia na dzie nowego miejsca pobytu. Zgaszajc si decydujesz si na pomoc."},"010":{"question":"Czy musz pomaga uchodcom finansowo?","answer":"Nie musisz udziela uchodcom adnej pomocy finansowej. Jest to wycznie Twoja dobra wola."},"011":{"question":"Czy musz zapewni uchodcom wyywienie?","answer":"Ze wzgldu na sytuacj uchodcw zapewnienie wyywienia, chociaby przez pocztkowy okres ich pobytu jest mile widziane, ale pozostaje dobrowolne."},"012":{"question":"Nie korzystam z Internetu, jak mog przyj uchodcw z Ukrainy?","answer":"Aby udzieli pomocy uchodcom z Ukrainy za pomoc naszego portalu, musisz si w nim zarejestrowa. Jeli jednak na co dzie nie korzystasz z Internetu, moesz poprosi o pomoc osoby, ktre z niego korzystaj."},"013":{"question":"Czy mog pobra od uchodcw opat za media?","answer":"Osoby przybywajce z Ukrainy ucieky przed wojn. Staraj si je wspiera w tym trudnym czasie. Jeli zdecydujesz si na pomoc uchodcom, uwzgldnij rwnie to, e Twoje rachunki za media mog wzrosn."}}},"003":{"name":"DLA UCHODCW / GOCI","content":{"001":{"question":"Jestem uchodc z Ukrainy, jak mam znale nocleg?","answer":"Aby znale lokum, zarejestruj si w portalu, podaj adres mailowy, numer telefonu i aktywuj konto, a w  formularzu wylistuj swoje potrzeby.\\n\\nTak szybko, jak tylko znajdziemy dla Ciebie potencjalnego gospodarza  poinformujemy Ci o tym mailowo i SMS-em. Bdziesz mg wtedy wej na portal, przejrze profil gospodarza i zaakceptowa lub odrzuci jego ofert.\\n\\nW momencie, kiedy obie strony potwierdz poczenie, wymienimy midzy Wami szczegy kontaktowe  wyjanijcie ostatnie detale i potwierdcie, gdzie si spotkacie. Pamitaj, e nie wszyscy bd mwi po ukraisku  dlatego kontakt mailowy moe czasem by wygodniejsz opcj, gdy w internecie jest dostpnych wiele translatorw, ktrych moecie uy do przetumaczenia Waszej korespondencji.\\n"},"002":{"question":"Czy mog liczy na transport z granicy do miejsca docelowego?","answer":"Nie wszyscy oferujcy uchodcom lokum s zmotoryzowani lub mog zaoferowa transport. Oferta, ktr otrzymasz moe by oznaczona jako z transportem. W przeciwnym wypadku moesz poprosi gospodarza o pomoc w prywatnej korespondencji."},"003":{"question":"Czy mam zapaci za nocleg i wyywienie osobie, ktra mnie przyja pod swj dach?","answer":"Pomoc uchodcom jest bezinteresowna i bezpatna. Osoby, ktre rejestruj si w portalu i proponuj pomoc, nie oczekuj niczego w zamian. Pamitaj jednak, e serwis nie ponosi odpowiedzialnoci za to na jakich warunkach zostaniesz przyjty. Upewnij si czy kto nie bdzie oczekiwa od Ciebie czego w zamian."}}}}');

