module.exports = JSON.parse('{"001":{"name":"INFORMAII GENERALE","content":{"001":{"question":"Pentru ce se folosete acest portal?","answer":"Platforma uaSOS.org pune n legtur refugiaii n cutare de cazare cu persoanele private, instituiile, ONG-urile i companiile care ofer cazare. Spre deosebire de alte iniiative care colecteaz informaii similare, platforma uaSOS.org conecteaz automat anunurile celor care caut cazare cu ofertele nregistrate pentru a oferi cea mai bun ofert posibil unui grup ct mai mare de persoane. Mulumit platformei, personale n cutarea unei cazrii nu vor fi nevoite s verifice sute de oferte disponibile, ci li se va propune cea mai bun i actualizat ofert, conform nevoilor lor. nregistrarea pe platform nu e anonim, ceea ce ofer siguran tuturor celor implicai."},"002":{"question":"Cine a creat acest portal?","answer":"Iniiativa este susinut de ONG-uri poloneze i ucrainene, de administraii locale i de numeroase companii, care nu numai c ofer cea mai bun tehnologie, dar i fac posibil atingerea a sute de mii de persoane de ambele pri ale frontierei. Platforma a fost creat cu participarea a zeci de voluntari i se bazeaz pe un algoritm avansat, care n viitor ofer posibilitatea de a dezvolta platforma pentru a servi i altor nevoi (de exemplu, transportul)."},"003":{"question":"Este platforma sigur?","answer":"Platforma a fost complet securizat din punct de vedere juridic (inclusiv n ceea ce privete aspectele legate de RODO) de ctre experi care colaboreaz cu cabinetul de avocatur ID Advisory. De asemenea, platforma dispune de o serie de garanii tehnice, cum ar fi: datele cu caracter personal sunt prelucrate n cloud-ul Google, setul de date prelucrate este limitat, iar logarea are loc prin intermediul Facebook i Gmail, ceea ce asigur o securitate sporit. \\n\\nn acelai timp, nu putem verifica toate persoanele care completeaz formularele prin intermediul portalului, aa c v rugm s contactai gazda/gazda i s clarificai toate detaliile nainte de edere."},"004":{"question":"Cum mi creez un cont?","answer":"Pentru a crea un cont, va trebui s completai adresa de e-mail i numrul de telefon, la care va fi trimis un cod de verificare."},"005":{"question":"Trebuie s introduc datele mele personale?","answer":"Pentru a v nregistra n mod corespunztor, trebuie s furnizai adresa de e-mail i numrul de telefon. V solicitm numele pentru a facilita comunicarea ntre pri."},"006":{"question":"Ce este politica de confidenialitate i GDPR?","answer":"Pentru a citi politica de confidenialitate, accesai fila \\"Politica de confidenialitate\\"."},"007":{"question":"Pot s mi editez anunul?","answer":"Pentru a v edita anunul, dup ce v autentificai, facei clic pe meniul de lng anun (\\"trei puncte\\") i selectai funcia \\"Editare\\"."},"008":{"question":"Cum mi pot terge anunul?","answer":"V putei terge anunul n dou moduri: \\n\\ndup conectare, facei clic pe meniul de lng notificare (\\"trei puncte\\") i selectai funcia \\"tergere\\" sau \\n\\nn e-mailul \\"UA SOS - Am gsit un potenial oaspete pentru dumneavoastr\\" avei posibilitatea de a alege opiunea de a terge listarea."},"009":{"question":"Exist vreo tax pentru crearea unui cont?","answer":"Portalul este gratuit, este menit s ajute persoanele care fug de rzboiul din Ucraina. Nu se percepe nicio tax n nicio etap de nregistrare sau de utilizare a portalului nostru."},"010":{"question":"Cum funcioneaz algoritmul de potrivire a aplicaiilor? ","answer":"Algoritmul caut n ambele baze de date pentru a gsi ct mai multe conexiuni poteniale ntre gazde i poteniali oaspei, n funcie de cerinele acestora. La fiecare 15 minute, algoritmul este rulat pentru a gsi conexiuni pentru utilizatorii nou nregistrai, dar i pentru persoanele care nu au gsit nc o ofert - sau care au refuzat o ofert anterioar."},"011":{"question":"Voi fi informat cu privire la statutul meu? ","answer":"Da, v vom ine la curent cu situaia cererii dumneavoastr prin e-mail - verificai-v cutia potal n mod regulat.\\nn plus, atunci cnd gsim un potenial oaspete/gazd pentru dumneavoastr, v vom anuna prin SMS."}}},"002":{"name":"PENTRU CEI CARE OFER AJUTOR/GAZDE","content":{"001":{"question":"Vreau s ajut, cum pot fi gazd?","answer":"Pentru a pune un loc la dispoziie, nregistrai-v pe portal, furnizai adresa de e-mail, numrul de telefon i activai-v contul.\\n\\nImediat ce gsim un potenial oaspete pentru dvs., v vom informa prin e-mail i SMS, dup care vei putea intra pe portal, vei putea vedea informaiile cheie din formularul de potrivire a oaspetelui i vei putea accepta sau refuza oferta. \\n\\nDup ce ambele pri confirm legtura, vei face schimb de date de contact - clarificai ultimele detalii i confirmai unde v vei ntlni. Nu uitai c nu toat lumea va vorbi romn, aa c e-mailul poate fi uneori o opiune mai convenabil, deoarece exist multe opiuni de traducere automat disponibile pe internet pe care i putei folosi pentru a v traduce mesajele."},"002":{"question":"Vreau s ajut refugiai. Doar ucrainenii au nevoie de ajutor?","answer":"Cnd a izbucnit rzboiul, n Ucraina se aflau persoane de diferite naionaliti - de exemplu, erau la studii, n cltorii de afaceri, cu contracte etc. Noi ne dorim s ajutm toi oamenii, indiferent de naionalitate, cetenie, opinii politice, religie, orientare sexual sau apartenen la o minoritate etnic."},"003":{"question":"Pot indica cte persoane doresc s gzduiesc i dac este preferabil o familie cu copii, de exemplu?","answer":"Bineneles, toi cei care decid s ajute persoanele care vin din Ucraina pot declara cte persoane doresc s ajute prin gzduirea lor. De asemenea, putei indica dac suntei dispus s acceptai, de exemplu, o familie cu copii, animale etc."},"004":{"question":"Trebuie s m duc la frontier pentru a primi un refugiat?","answer":"n acest moment, portalul este destinat n primul rnd s v ajute s gsii cazare pentru refugiai. Dac avei posibilitatea de a prelua persoana de la grani sau dintr-un anumit loc, acest lucru este binevenit, dar nu este obligatoriu. Putei trimite astfel de informaii suplimentare n formular. n viitor, vor fi adugate funcionaliti suplimentare pentru a v ajuta s gsii mijloace de transport, locuri de munc etc."},"005":{"question":"Nu vorbesc ucrainean, cum pot s comunic?","answer":"Forma preferat de comunicare este prin e-mail. Nu este nevoie s cunoatei limba ucrainean pentru a comunica cu o persoan care o vorbete. Exist numeroase programe de traducere disponibile pe internet pe care le putei folosi pentru a v traduce corespondena."},"006":{"question":"Trebuie s-mi dau adresa de domiciliu?","answer":"Pentru a v crea un cont pe portal, trebuie s v furnizai adresa de domiciliu. Aceasta nu va fi afiat oaspetelui - acesta va vedea doar oraul de cazare. V sugerm ca gazda i oaspetele s se ntlneasc ntr-un spaiu public."},"007":{"question":"Pentru ce perioad minim de timp pot gzdui o persoan din Ucraina?","answer":"Timpul minim pentru a gzdui o persoan din Ucraina este de o noapte."},"008":{"question":"Serviciul verific utilizatorii portalului?","answer":"Utilizatorii se logheaz folosind profilul lor prin e-mail, Facebook sau Gmail, iar numerele lor de telefon sunt verificate"},"009":{"question":"Pot s renun la gzduirea unui refugiat?","answer":"Suntem contieni de faptul c viaa se ntmpl n diverse situaii aleatorii, prin urmare, putei renuna la gzduirea refugiailor n orice moment. Cu toate acestea, v rugm s v amintii c oferta dvs. de a gzdui persoane din Ucraina este important pentru ei i este posibil ca acetia s nu poat gsi un nou loc unde s rmn peste noapte. Prin voluntariat, decidei s ajutai."},"010":{"question":"Trebuie s-i ajut financiar pe refugiai?","answer":"Nu trebuie s oferii niciun fel de asisten financiar refugiailor, ci doar bunvoina dumneavoastr."},"011":{"question":"Trebuie s asigur hran pentru refugiai?","answer":"Avnd n vedere situaia refugiailor, furnizarea de alimente, cel puin pentru perioada iniial a ederii lor, este binevenit, dar rmne voluntar."},"012":{"question":"Nu folosesc internetul, cum pot gzdui refugiai din Ucraina?","answer":"Pentru a ajuta refugiaii din Ucraina prin intermediul portalului nostru, trebuie s v nregistrai pe acesta. Cu toate acestea, dac nu folosii internetul zilnic, putei solicita ajutorul unor persoane care l folosesc."},"013":{"question":"Pot s le cer refugiailor plata utilitilor?","answer":"Oamenii care vin din Ucraina au fugit din calea rzboiului. ncercai s i sprijinii n aceast perioad dificil. Dac decidei s ajutai refugiaii, luai n considerare i faptul c facturile la utiliti ar putea crete."}}},"003":{"name":"PENTRU REFUGIAI / VIZITATORI","content":{"001":{"question":"Sunt un refugiat din Ucraina, cum pot gsi cazare?","answer":"Pentru a gsi cazare, nregistrai-v pe portal, furnizai adresa de e-mail, numrul de telefon, activai-v contul i enumerai-v nevoile n formular.\\n\\nDe ndat ce gsim o gazd potenial pentru dvs., v vom informa prin e-mail i SMS. Vei putea apoi s accesai portalul, s vedei profilul gazdei i s acceptai sau s refuzai oferta acesteia.\\n\\nDup ce ambele pri confirm conexiunea, vei face schimb de date de contact - clarificai ultimele detalii i confirmai unde v vei ntlni. Nu uitai c nu toat lumea va vorbi ucrainean - astfel nct contactul prin e-mail poate fi uneori o opiune mai convenabil, deoarece exist muli traductori disponibili online pe care i putei folosi pentru a v traduce conversaia."},"002":{"question":"Pot conta pe transport de la frontier pn la destinaia final?","answer":"Nu toi cei care ofer cazare pentru refugiai sunt motorizabili sau pot oferi transport. Este posibil ca oferta pe care o primii s fie marcat cu meniunea \\"cu transport\\". n caz contrar, putei solicita asisten gazdei dumneavoastr prin coresponden privat."},"003":{"question":"Ar trebui s pltesc cazarea i masa pentru persoana care m-a primit la ea?","answer":"Ajutarea refugiailor este dezinteresat i gratuit. Persoanele care se nregistreaz pe portal i ofer ajutor nu se ateapt la nimic n schimb. Amintii-v, totui, c serviciul nu este responsabil pentru condiiile n care vei fi acceptat. Asigurai-v c nu v ateptai la nimic n schimb."}}}}');

